package com.duanrong.business.cache.model;

import java.util.Date;

public class CacheKey {

	private int id;
	//key
	private String key;
	
	//hashkay
	private String hashKey;
	
	//缓存数据类型
	private String type;
	//缓存域
	private String domain;
	//说明
	private String info;
	//描述
	private String descrip;
	//创建人
	private String createUser;
	//申请人
	private String applicant;
	//创建时间
	private Date createTime;
	//最后更新人
	private String updateUser;
	//最后更新时间
	private Date updateTime;
	//备注
	private String remark;
	
	private int pid;

	public int getId() {
		return id;
	}

	public void setId(int id) {
		this.id = id;
	}

	public String getKey() {
		return key;
	}

	public void setKey(String key) {
		this.key = key;
	}
	
	public String getHashKey() {
		return hashKey;
	}

	public void setHashKey(String hashKey) {
		this.hashKey = hashKey;
	}

	public String getType() {
		return type;
	}

	public void setType(String type) {
		this.type = type;
	}

	public String getDomain() {
		return domain;
	}

	public void setDomain(String domain) {
		this.domain = domain;
	}

	public String getInfo() {
		return info;
	}

	public void setInfo(String info) {
		this.info = info;
	}

	public String getDescrip() {
		return descrip;
	}

	public void setDescrip(String descrip) {
		this.descrip = descrip;
	}

	public String getCreateUser() {
		return createUser;
	}

	public void setCreateUser(String createUser) {
		this.createUser = createUser;
	}

	public String getApplicant() {
		return applicant;
	}

	public void setApplicant(String applicant) {
		this.applicant = applicant;
	}

	public Date getCreateTime() {
		return createTime;
	}

	public void setCreateTime(Date createTime) {
		this.createTime = createTime;
	}

	public String getUpdateUser() {
		return updateUser;
	}

	public void setUpdateUser(String updateUser) {
		this.updateUser = updateUser;
	}

	public Date getUpdateTime() {
		return updateTime;
	}

	public void setUpdateTime(Date updateTime) {
		this.updateTime = updateTime;
	}

	public String getRemark() {
		return remark;
	}

	public void setRemark(String remark) {
		this.remark = remark;
	}

	public int getPid() {
		return pid;
	}

	public void setPid(int pid) {
		this.pid = pid;
	}

	@Override
	public String toString() {
		return "CacheKey [id=" + id + ", key=" + key + ", hashKey=" + hashKey
				+ ", type=" + type + ", domain=" + domain + ", info=" + info
				+ ", descrip=" + descrip + ", createUser=" + createUser
				+ ", applicant=" + applicant + ", createTime=" + createTime
				+ ", updateUser=" + updateUser + ", updateTime=" + updateTime
				+ ", remark=" + remark + ", pid=" + pid + "]";
	}
	
}
